import React from 'react';
import ReactDOM from 'react-dom';


function myFunction(){
  render (
    <div>
      <h1>Geofrey</h1>
      <p>Je suis un étudiant qui n'a pas de stage</p>
      <ul>
        <li>GridPocket me snobbe</li>
        <li>aucune réponse de la part des autres entreprises</li>
        <li>Même les profs </li>
      </ul>
    </div>
  );
}

ReactDOM.render(
  <myFunction />,
  document.getElementById('root')
);
